if mibBuilder.loadTexts: ciscoBootHwDiagsMIBConfigCode.setDescription('This object provides additional optional detailed configuration options (sub-tests configurations) for a diagnostics test category. The decoding of this unsigned 32-bit integer is platform-specific and allows for many platform-specific configurations. For the CLI example above, a ciscoBootHwDiagsMIBConfigCode for the FPGA(s) test category will cause all FPGA tests to be disabled, whereas, a ciscoBootHwDiagsMIBConfigCode of 1 will enable FPGA1 test. A ciscoBootHwDiagsMIBConfigCode of 3 will enable FPGA1 AND FPGA2-subtest1, and so forth (since there is only one test for FPGA1, but two tests for FPGA2). Hence the encoding is platform dependent and flexible.')
